Ext.data.JsonP['Titanium_SDK_5.2.2_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Titanium SDK 5.2.2.GA - 4 April 2016</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p>\n\t\t</div>\n        <div class=\"header\"/>\n\n        <div id=\"src-46247690\" class=\"content\">\n                        <h1>Titanium SDK 5.2.2.GA - 4 April 2016</h1>\n    <div class=\"section section-2 \" id=\"src-46247690_TitaniumSDK5.2.2ReleaseNote-Contents\">\n        <h2 class=\"heading \"><span>Contents</span></h2>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_5.2.2_Release_Note-section-src-46247690_TitaniumSDK5.2.2ReleaseNote-AboutThisRelease\">About This Release</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_5.2.2_Release_Note-section-src-46247690_TitaniumSDK5.2.2ReleaseNote-FixedIssues\">Fixed Issues</a>    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-46247690_TitaniumSDK5.2.2ReleaseNote-AboutThisRelease\">\n        <h2 class=\"heading \"><span>About This Release</span></h2>\n    <p>Titanium SDK 5.2.2.GA is a patch release of the SDK, addressing high-priority issues from previous releases.    </p>\n    <p>    <span id=\"src-46247690_issues\"><a name=\"src-46247690_issues\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-46247690_TitaniumSDK5.2.2ReleaseNote-FixedIssues\">\n        <h2 class=\"heading \"><span>Fixed Issues</span></h2>\n<ul class=\" \"><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/ALOY-1368\" target=\"_blank\">ALOY-1368</a> - Complex data binding for individual model doesn&apos;t work with transform() method    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/ALOY-1369\" target=\"_blank\">ALOY-1369</a> - Complex data binding for collection doesn&apos;t work with transform    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/ALOY-1474\" target=\"_blank\">ALOY-1474</a> - Regression: Model data binding no longer works    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/ALOY-1477\" target=\"_blank\">ALOY-1477</a> - Regression: Missing model attributes cause error on collection data binding    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/ALOY-1479\" target=\"_blank\">ALOY-1479</a> - Regression: Model instance data binding no longer works    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-20443\" target=\"_blank\">TIMOB-20443</a> - Custom Database Path (Android) Does Not Create New DB with Ti.Database.open    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-20627\" target=\"_blank\">TIMOB-20627</a> - iOS: App rejected by Apple due to use of the nativeObject API    </p>\n</li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=46247690\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Titanium SDK 5.2.2 Release Note"});